                <img src="\assets\wrkbg2.webp" className="img-fluid" />
              </div>
            </SwiperSlide>
            <SwiperSlide>
              <div className="wrkbg-img">
                <img src="\assets\wrkbg3.jpeg" className="img-fluid" />
